jQuery(document).ready(function(t){t(".correct-setting").on("click",function(e){e.preventDefault();var s=t(this).data("title"),a=t(this).data("content"),i=t(this).data("page-template"),n=t(this).data("setting-group"),o=t(this).data("setting-key");$this=t(this);var r={action:"yolo_setup",title:s,content:a,page_template:i,setting_group:n,setting_key:o};t.post(yoloSetup.ajax_url,r,function(e){e=t.parseJSON(e),$this.closest("tr").find("mark.error").html(e.id+" - /"+e.slug+"/").removeClass("error").addClass("yes"),$this.closest(".button").hide()})})});